import React, { Component } from 'react'

export default class Order extends Component {
  render() {
    const orderIds = Object.keys(this.props.order);
    const total = orderIds.price;
    console.log(orderIds.price)
    return (
      <div className="order-wrap">
        <h2>Order</h2>
        <ul>
          <li>{orderIds}</li>
          {total}
        </ul>
      </div>
    )
  }
}
